    "contracts/FoxLockReward.sol": {
      "content": "// "SPDX-License-Identifier: UNLICENSED"

pragma solidity 0.6.12;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Context.sol";

import "hardhat/console.sol";

contract FoxLockReward is AccessControl, Ownable {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    uint256 public constant PERCENT_PRECISION = 1e18; // 1%
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    IERC20 public foxToken;

    uint256 public startLockTime;
    uint256 public totalReward;

    uint256[] public unlockSteps;

    // unlock step => unlock percent
    mapping(uint256 => uint256) public unlockPercents;

    // wallet address => fox amount
    mapping(address => uint256) public rewards;

    // wallet address => step => claimed?
    mapping(address => mapping(uint256 => bool)) public claimStatus;

    constructor(address _foxToken, address _admin) public {
        foxToken = IERC20(_foxToken);

        // Thursday, September 9, 2021 12:00:00 AM GMT+07:00
        startLockTime = 1631120400;

        // Friday, September 9, 2022 12:00:00 AM GMT+07:00
        unlockSteps.push(1662656400);

        // Saturday, September 9, 2023 12:00:00 AM GMT+07:00
        unlockSteps.push(1694192400);

        // Monday, September 9, 2024 12:00:00 AM GMT+07:00
        unlockSteps.push(1725814800);

        // Tuesday, September 9, 2025 12:00:00 AM GMT+07:00
        unlockSteps.push(1757350800);

        // Wednesday, September 9, 2026 12:00:00 AM GMT+07:00
        unlockSteps.push(1788886800);        

        unlockPercents[0] = 10 * PERCENT_PRECISION; // step 0 = 10%
        unlockPercents[1] = 10 * PERCENT_PRECISION; // step 1 = 10%
        unlockPercents[2] = 15 * PERCENT_PRECISION; // step 2 = 15%
        unlockPercents[3] = 15 * PERCENT_PRECISION; // step 3 = 15%
        unlockPercents[4] = 50 * PERCENT_PRECISION; // step 4 = 50%

        _setupRole(DEFAULT_ADMIN_ROLE, _admin);
        _setupRole(ADMIN_ROLE, _admin);
        _setupRole(MINTER_ROLE, _admin);        
    }

    function lock(address _wallet, uint256 _amount) external {
        require(hasRole(MINTER_ROLE, msg.sender), "Caller is no permission");
        require(currentTime() < unlockSteps[0], "Timeout");
        rewards[_wallet] = rewards[_wallet].add(_amount);
        totalReward = totalReward.add(_amount);
        require(
            foxToken.balanceOf(address(this)) >= totalReward,
            "FOX token is not enough"
        );
    }

    function batchLock(address[] calldata _wallets, uint256[] calldata _amounts)
        external
    {
        require(hasRole(MINTER_ROLE, msg.sender), "Caller is no permission");
        require(currentTime() < unlockSteps[0], "Timeout");
        require(_wallets.length == _amounts.length);
        for (uint256 i; i < _wallets.length; i++) {
            rewards[_wallets[i]] = rewards[_wallets[i]].add(_amounts[i]);
            totalReward = totalReward.add(_amounts[i]);
        }
        require(
            foxToken.balanceOf(address(this)) >= totalReward,
            "FOX token is not enough"
        );
    }

    function claim(uint256 _step) external {
        require(!claimStatus[msg.sender][_step], "Already claimed");
        uint256 _amount = claimableReward(msg.sender, _step);
        require(_amount > 0, "No reward");
        claimStatus[msg.sender][_step] = true;
        totalReward = totalReward.sub(_amount);
        foxToken.safeTransfer(msg.sender, _amount);
    }

    function flush() external  {
        require(hasRole(ADMIN_ROLE, msg.sender), "Caller is no permission");
        uint256 _amount = foxToken.balanceOf(address(this));
        require(_amount > 0, "No FOX left");
        foxToken.safeTransfer(msg.sender, _amount);
    }

    function claimableReward(address _wallet, uint256 _step)
        public
        view
        returns (uint256 rewardAmount)
    {
        uint256 _lockAmount = rewards[_wallet];
        uint256 _unlockTime = unlockSteps[_step];
        rewardAmount = 0;
        if (currentTime() >= _unlockTime) {
            rewardAmount = _lockAmount.mul(unlockPercents[_step]).div(
                PERCENT_PRECISION.mul(100)
            );
        }
    }

    function currentTime() public view virtual returns (uint256) {
        return now;
    }
}
"
    },
